import { Box, Typography } from "@mui/material";
import React from "react";

function PlayStore() {
  return (
    <Box
      sx={{
        display: "grid",
        maxWidth: "100%",
        margin: "0 auto",
        padding: 0,
        height: "550px",
        backgroundColor: "#e3f2fd",
        marginTop: "50px",
        placeItems: "center", // Centers text horizontally & vertically
        textAlign: "center", // Aligns text center
      }}
    >
      <Typography
        sx={{
          fontFamily: "Manrope, sans-serif !important",
          fontSize: "2.9rem",
          fontWeight: "700",
          lineHeight: 1.2,
          letterSpacing: "0.015em",
          wordSpacing: "0.001em",
          position: "relative",
          display: "inline-block",
          "&::after": {
            content: '""',
            position: "absolute",
            left: "50%",
            transform: "translateX(-50%)",
            bottom: "-8px",
            width: "120px",
            height: "4px",
            backgroundColor: "black", // Underline in black
            borderRadius: "5px",
          },
        }}
      >
        Download the{" "}
        <Box component="span" sx={{ color: "#3593b0" }}>
          MyMoneyMantra
        </Box>
        <br />
        Mobile App
      </Typography>
    </Box>
  );
}

export default PlayStore;
